alias modeclist {
  did -r srvrdialog 1
  window -h @refserv
  if ($isfile(scripts\tmp\readserv.txt)) {
    .fopen serv scripts\tmp\readserv.txt
    while (!$feof) {
      var %1 = $fread(serv)
      var %2 = $iif($gettok(%1,1,32) == +f,$gettok(%1,2,32),n/a)
      var %3 = $iif($gettok(%1,1,32) == +f,$gettok(%1,3,32),$gettok(%1,2,32))
      var %4 = $iif($gettok(%1,1,32) == +f,$gettok(%1,4-7,32),$gettok(%1,3-6,32))
      if (%1) { did -a srvrdialog 1 + 0 0 0 $gettok(%1,1,32) 	+ 0 0 0 %2 	+ 0 0 0 %3 	+ 0 0 0 %4 }
    }
    .fclose serv
  }
  close -@ @refserv
  .remove scripts\tmp\readserv.txt
}

