using UnityEngine;
using UnityEngine.Rendering;
using UnityEngine.Rendering.Universal;

class WasdBlitRendererFeature : ScriptableRendererFeature {
    class WasdBlitPass : ScriptableRenderPass { 
        private ProfilingSampler _profilingSampler = new ProfilingSampler("WasdBlitPass");
        private RenderTexture _gameWindowTexture;

        public WasdBlitPass(RenderTexture gameTex) {
            _gameWindowTexture = gameTex;
            renderPassEvent = RenderPassEvent.AfterRenderingPostProcessing;
        }

        public override void Execute(ScriptableRenderContext context, ref RenderingData renderingData) {
            if (_gameWindowTexture == null) return;
            
            var camera = renderingData.cameraData.camera;
            if (camera.cameraType != CameraType.Game) return;
            if (!camera.name.Equals("BaseCam")) return; // oops I hard coded it ¯\_(ツ)_/¯
            
            
            CommandBuffer cmd = CommandBufferPool.Get();

            using (new ProfilingScope(cmd, _profilingSampler)) {
                // not using offset until I know blit works on its own.
                int offset = (camera.scaledPixelWidth - (_gameWindowTexture.width / _gameWindowTexture.height) * camera.scaledPixelHeight) / 2;
                cmd.Blit(_gameWindowTexture, camera.targetTexture,
                    Vector2.one*50, Vector2.zero /*new Vector2(offset, 0)*/); 
            }

            context.ExecuteCommandBuffer(cmd);
            cmd.Clear();
            CommandBufferPool.Release(cmd);
        }
    }
    
    public RenderTexture gameTexture;
    private WasdBlitPass _renderPass;

    public override void AddRenderPasses(ScriptableRenderer renderer, ref RenderingData renderingData) {
        if (renderingData.cameraData.cameraType == CameraType.Game) {
            // Calling ConfigureInput with the ScriptableRenderPassInput.Color argument
            // ensures that the opaque texture is available to the Render Pass.
            _renderPass.ConfigureInput(ScriptableRenderPassInput.Color);
            renderer.EnqueuePass(_renderPass);
        }
    }

    public override void Create() {
        _renderPass = new WasdBlitPass(gameTexture);
    }

    protected override void Dispose(bool disposing) {
    }
}

