// filter constructor
import { Model, Op } from 'sequelize';
import { Ticker } from 'src/database/models';
import TickersSearchParamsDto from 'src/tickers/dto/tickers-search-params.dto';

abstract class RequestFilter<
  K extends object = object,
  T extends Model = Model,
> {
  constructor(
    queryParams: Partial<Record<keyof K, string | number | boolean>>,
  ) {
    this.queryParams = queryParams;
  }

  public abstract serialize();
  protected modelClass: T | null = null;
  protected queryParams: Record<string, any> = {};
}

export enum LookupType {
  EXACT = 1,
  NOT_EQUAL = -1,
  STARTS_WITH = 2,
  NOT_STARTS_WITH = -2,
  ENDS_WITH = 3,
  NOT_ENDS_WITH = -3,
  CONTAINS = 4,
  NOT_CONTAINS = -4,
  IN = 5,
  NOT_IN = -5,
  GREATER_THAN = 6,
  LESS_THAN = -6,
  NOT_NULL = 7,
  IS_NULL = -7,
}

const LookupTypeMap: Record<LookupType, symbol> = {
  [LookupType.EXACT]: Op.eq,
  [LookupType.NOT_EQUAL]: Op.ne,
  [LookupType.STARTS_WITH]: Op.startsWith,
  [LookupType.ENDS_WITH]: Op.endsWith,
  [LookupType.CONTAINS]: Op.contains,
  [LookupType.IN]: Op.in,
  [LookupType.GREATER_THAN]: Op.gt,
  [LookupType.NOT_NULL]: Op.ne,
  [LookupType.LESS_THAN]: Op.lt,
  [LookupType.NOT_STARTS_WITH]: Op.notLike,
  [LookupType.NOT_ENDS_WITH]: Op.notLike,
  [LookupType.NOT_CONTAINS]: Op.notLike,
  [LookupType.NOT_IN]: Op.notIn,
  [LookupType.IS_NULL]: Op.eq,
};

type FilterType<T extends object = object> = {
  key: keyof T;
  lookup_type: LookupType;
};

function isFilterType<T extends object = object>(
  value: unknown,
): value is FilterType<T> {
  if (typeof value !== 'object' || value === null) {
    return false;
  }

  const { key, lookup_type } = value as FilterType<T>;

  if (typeof key !== 'string' || typeof lookup_type !== 'number') {
    return false;
  }

  return true;
}

export class TickersFilter extends RequestFilter<
  TickersSearchParamsDto,
  Ticker
> {
  constructor(
    queryParams: Partial<
      Record<keyof TickersSearchParamsDto, string | number | boolean>
    >,
  ) {
    super(queryParams);
  }

  public instrument_type: FilterType<Ticker> = {
    key: 'tradecurrency',
    lookup_type: LookupType.EXACT,
  };

  public marketplace: FilterType<Ticker> = {
    key: 'marketplaceId',
    lookup_type: LookupType.EXACT,
  };

  public hasMarketplace: FilterType<Ticker> = {
    key: 'marketplaceId',
    lookup_type: LookupType.NOT_NULL,
  };

  public serialize() {
    const lookups = Object.keys(this).reduce((acc, key) => {
      const value = this[key as keyof this];

      if (!isFilterType<Ticker>(value)) {
        return acc;
      }

      const { key: filterKey } = value;
      let { lookup_type } = value;

      console.log({
        filterKey,
        lookup_type,
      });

      if (this.queryParams[key] === undefined) {
        return acc;
      }

      const lookupValue = (() => {
        let paramValue = this.queryParams[key];

        if (
          (typeof paramValue === 'string' && paramValue.startsWith('!')) ||
          (typeof paramValue === 'boolean' && paramValue === true)
        ) {
          lookup_type = -lookup_type;
        }

        paramValue =
          typeof paramValue === 'string'
            ? paramValue.replace('!', '')
            : paramValue;

        if (lookup_type === LookupType.EXACT) {
          return paramValue;
        }

        if (lookup_type === LookupType.IN) {
          return paramValue.split(',');
        }

        if (lookup_type === LookupType.GREATER_THAN) {
          return Number(paramValue);
        }

        if (
          lookup_type === LookupType.NOT_NULL ||
          lookup_type === LookupType.IS_NULL
        ) {
          return null;
        }

        return paramValue;
      })();

      acc[filterKey] = {
        [LookupTypeMap[lookup_type]]: lookupValue,
      };

      return acc;
    }, {} as Record<keyof Ticker, any>);

    const whereObject = {
      where: lookups,
    };

    return whereObject;
  }
}

