export function fib(n: number, memo = {}) {
  if (memo[n]) return memo[n];
  if (n <= 2) return 1;

  memo[n] = fib(n - 1, memo) + fib(n - 2, memo);
  return memo[n];
}

export function naiveFib(n: number) {
  if (n <= 2) return 1;

  return naiveFib(n - 1) + naiveFib(n - 2);
}

/**
  You're given two positive integers representing the width and height of a
  grid-shaped, rectangular graph. Write a function that returns the number of
  ways to reach the bottom right corner of the graph when starting at the top
  left corner.
  
  Each move you take must either go down or right. In other words,
  you can never move up or left in the graph.

  
  For example, given the graph illustrated below, with width = 2 and height = 3
  there are three ways to reach the bottom right corner when starting at the top left corner
     _  _
    |_|_|
    |_|_|
    |_|_|

    1. Down Down Right
    2. Right Down Down
    3. Down Right Down

  You may assume that the graph will never be a 1x1 grid
 */

export function numberOfWays(w: number, h: number, memo = {}) {
  const key = w + "" + h;
  if (memo[key]) return memo[key];

  if (w === 0 || h === 0) return 0;
  else if (w === 1 && h === 1) return 1;

  const right = numberOfWays(w - 1, h, memo);
  const down = numberOfWays(w, h - 1, memo);

  memo[key] = right + down;
  return memo[key];
}

export function numberOfWaysNaive(w: number, h: number) {
  if (w === 0 || h === 0) return 0;
  else if (w === 1 && h === 1) return 1;

  const right = numberOfWaysNaive(w - 1, h);
  const down = numberOfWaysNaive(w, h - 1);
  return right + down;
}

